    <meta property="og:title" content="Keqing-site login page" />

    <meta

    <title>Login</title>
    <link rel="preconnect" href="https://fonts.googleapis.com" />
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin />

  <body>
    <main>
      <section class="content">
        <div class="content__title">
          <h2>Keqing</h2>
          <p>welcome to me home</p>
        </div>
        <form id="form" class="content__form">
          <input
            type="email"
            placeholder="Email"
            minlength="6"
            id="email"
            pattern="/^[\w-\\.]+@([\w-]+\.)+[\w-]{2,4}$/g"
            required
          />
          <input
            type="password"
            placeholder="Password"
            minlength="6"
            maxlength="20"
            id="password"
            required
          />
          <button id="btn-form" type="submit">Log in</button>
        </form>
        <div class="content__another">
          <div class="content__another__reset hidden">
            <button>Reset Password</button>
          </div>
          <p>or</p>
          <div class="content__another__links">
            <a href="/registration">Registration</a>
            <button id="google" type="button">Google</button>
          </div>
        </div>
        <img class="content__reaction" src="pages/login/img/reaction.svg" alt="Keqing reaction" />
      </section>
